import React, { useState } from 'react';
import './App.css'

const Home = () => {

  const [isDropdownOpen, setIsDropdownOpen] = useState();
  const toggleDropdown = ()=>{
    setIsDropdownOpen(!isDropdownOpen);
  };


  return (
    <>
    <header>
      <nav className='nav-left'>
        <a href="/">Tool Home</a> |  <div className="dropdown" onMouseEnter={toggleDropdown} onMouseLeave={toggleDropdown}>
          <a href="#!" className="dropbtn">Go to</a>
          {isDropdownOpen && (
            <div className="dropdown-content">
              <a href="/section1">Section 1</a>
              <a href="/section2">Section 2</a>
              <a href="/section3">Section 3</a>
            </div>
          )}
        </div> | <a href="/contact">Refresh</a>
         | <a href="/contact">Corpus</a>
         | <a href="/contact">View Skipped</a>
         | <a href="/contact">About Tool</a>
         | <a href="/contact">Help & FAQ</a>
         | <a href="/contact">Report Blog</a>
       <button className='logout'>logout</button>
      </nav>
    </header>
  <div className='container'>
      <div>current user : <label>(user)</label></div>
      <div>current sentence : <label>(sentence)</label></div>
      <div>first sentence</div>
  </div>

  <div className='container2'>
      <div>Language : <label>(user)</label></div>
      <div>current sentence : <label>(sentence)</label></div>
      <div>first sentence</div>
  </div>
  </>
  );
};

export default Home;
